// src/components/work/common/SriLankaMap.jsx
import React, { useState } from 'react';
import './SrilankaMap.css';

const SriLankaMap = () => {
  const [selectedDestination, setSelectedDestination] = useState(null);

  const destinations = [
    { id: 1, name: "Colombo", guides: 45, type: "city" },
    { id: 2, name: "Kandy", guides: 32, type: "cultural" },
    { id: 3, name: "Galle", guides: 28, type: "coastal" },
    { id: 4, name: "Sigiriya", guides: 18, type: "historical" },
    { id: 5, name: "Ella", guides: 22, type: "nature" },
    { id: 6, name: "Nuwara Eliya", guides: 25, type: "hill" },
    { id: 7, name: "Yala National Park", guides: 15, type: "wildlife" },
    { id: 8, name: "Anuradhapura", guides: 20, type: "historical" },
    { id: 9, name: "Mirissa", guides: 16, type: "beach" },
    { id: 10, name: "Polonnaruwa", guides: 14, type: "historical" }
  ];

  const getDestinationIcon = (type) => {
    switch(type) {
      case 'city': return 'üèôÔ∏è';
      case 'cultural': return 'üèõÔ∏è';
      case 'coastal': return 'üèñÔ∏è';
      case 'historical': return 'üè∫';
      case 'nature': return 'üå≥';
      case 'hill': return '‚õ∞Ô∏è';
      case 'wildlife': return 'üêò';
      case 'beach': return 'üåä';
      default: return 'üìç';
    }
  };

  return (
    <div className="sri-lanka-map">
      <div className="map-container">
        <div className="map-header">
          <h2 className="map-title">Explore Sri Lanka</h2>
          <p className="map-subtitle">Find guides in different destinations across the island</p>
        </div>

        {/* Map Visualization */}
        <div className="map-visual">
          <div className="map-simplified">
            <div className="island-shape">
              <div className="destination-points">
                {destinations.map(dest => (
                  <button
                    key={dest.id}
                    className={`destination-point ${selectedDestination?.id === dest.id ? 'selected' : ''}`}
                    onClick={() => setSelectedDestination(dest)}
                    style={{
                      left: `${Math.random() * 80 + 10}%`,
                      top: `${Math.random() * 80 + 10}%`
                    }}
                    aria-label={`Show ${dest.name} details`}
                  >
                    <span className="point-icon">{getDestinationIcon(dest.type)}</span>
                    <span className="point-label">{dest.name}</span>
                  </button>
                ))}
              </div>
            </div>
          </div>
        </div>

        {/* Destination List */}
        <div className="destination-list">
          <h3 className="list-title">Popular Destinations</h3>
          <div className="destinations-grid">
            {destinations.map(dest => (
              <div 
                key={dest.id} 
                className={`destination-item ${selectedDestination?.id === dest.id ? 'selected' : ''}`}
                onClick={() => setSelectedDestination(dest)}
              >
                <div className="dest-info">
                  <span className="dest-icon">{getDestinationIcon(dest.type)}</span>
                  <div>
                    <div className="dest-name">{dest.name}</div>
                    <div className="dest-type">{dest.type}</div>
                  </div>
                </div>
                <div className="dest-guides">{dest.guides} guides</div>
              </div>
            ))}
          </div>
        </div>

        {/* Selected Destination Details */}
        {selectedDestination && (
          <div className="selected-destination">
            <h3 className="selected-title">{selectedDestination.name}</h3>
            <div className="selected-details">
              <div className="detail">
                <span className="label">Type:</span>
                <span className="value">{selectedDestination.type}</span>
              </div>
              <div className="detail">
                <span className="label">Available Guides:</span>
                <span className="value">{selectedDestination.guides} guides</span>
              </div>
            </div>
            <button 
              className="find-guides-btn"
              onClick={() => window.location.href = `/guides?location=${selectedDestination.name}`}
            >
              Find Guides in {selectedDestination.name}
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default SriLankaMap;
